fprintf(stderr, "Waiting for training to finish\n");

/*
The protocol for using these registers can be broken down into the following steps:
1. Poll the UctWriteProtShadow, looking for a 0
2. When a 0 is seen, read the UctWriteOnlyShadow register to get the major message number. If
reading a streaming message, also read the UctDatWriteOnlyShadow register.
3. Write the DctWriteProt to 0 to acknowledge the receipt of the message
4. Poll the UctWriteProtShadow, looking for a 1
5. When a 1 is seen, write the DctWriteProt to 1 to complete the protocol
6. Go to step 1.
*/

int training_complete = 0;

// While completion message is not seen, keep reading message from mailbox
while (training_complete == 0) {
  int cnt = 0;

  //Step1: Poll the UctWriteProtShadow, looking for a 0
  this->ht->OURSBUS_READ_4B (STATION_DDR_TOP_DDR_PHY_ADDR + 4 * 0xd0004, rdata);
  while ((rdata & 0x1) != 0) {
    this->ht->OURSBUS_READ_4B (STATION_DDR_TOP_DDR_PHY_ADDR + 4 * 0xd0004, rdata);
    cnt++;
    if (cnt % 1000 == 0) {
      fprintf(stderr, "polling for 0, %d UctWriteProtShadow read back %x\n", cnt, rdata);
    }
  }
  cnt = 0;

  // Step2: When a 0 is seen, read the UctWriteOnlyShadow register to get the major message number
  // If reading a streaming message, also read the UctDatWriteOnlyShadow register
  this->ht->OURSBUS_READ_4B (STATION_DDR_TOP_DDR_PHY_ADDR + 4 * 0xd0032, rdata);
  fprintf(stderr, "UctWriteOnlyShadow read back %x\n", rdata);

  // Check if training completes
  if ((rdata & 0xff) == 0x7) { //training run successfully
    training_complete = 1;
    fprintf(stderr, "Training complete successfully!\n");    
  } else if ((rdata & 0xff) == 0xff) { // training failed
    training_complete = 1;
    fprintf(stderr, "Training complete but failed!\n");    
  } else if ((rdata & 0xff) == 0x8) { // streaming message
    this->ht->OURSBUS_READ_4B (STATION_DDR_TOP_DDR_PHY_ADDR + 4 * 0xd0034, rdata);
    fprintf(stderr, "Streaming message read back %x\n", rdata);
  }

  // Step3: Write the DctWriteProt to 0 to acknowledge the receipt of the message
  this->ht->OURSBUS_WRITE(STATION_DDR_TOP_DDR_PHY_ADDR + 4 * 0xd0031, 0);

  // Step4: Poll the UctWriteProtShadow, looking for a 1
  this->ht->OURSBUS_READ_4B  (STATION_DDR_TOP_DDR_PHY_ADDR + 4 * 0xd0004, rdata);
  while ((rdata & 0x1) != 0x1) {
    this->ht->OURSBUS_READ_4B  (STATION_DDR_TOP_DDR_PHY_ADDR + 4 * 0xd0004, rdata);
  }

  // Step5: When a 1 is seen, write the DctWriteProt to 1 to complete the protocol
  this->ht->OURSBUS_WRITE(STATION_DDR_TOP_DDR_PHY_ADDR + 4 * 0xd0031, 1);  
}
